Российским мобильным операторам хватает оборудования, в том числе не останавливается стройка новых базовых станций, сообщает Минцифры РФ со ссылкой на президента МТС Вячеслава Николаева. 

«Оборудования хватает, стройку ведём: несколько сотен наших собственных базовых станций поставим на сети уже в этом году, планируем выйти на темп производства 10-20 тыс. базовых станций в год», заявил Николаев.
{$MTSS} {$RTKM} {$TTLK}

😎 Приветствую Друзья! Вы тоже ищите компании, которые завтра вырастут на 10-20%? Тогда этот пост для Вас 😌 👇

‼️Сейчас стало намного опасней инвестировать чем раньше! 

👆 Хочу всех предупредить, особенно новичков, которые пришли на биржу меньше 6 месяцев назад (если это ты, поставь реакцию "₽" на пост)!

Вернёмся к нашей опасности:

Сейчас будут взлетать всякие случайные компании и акции, про которых Вы никогда не слышали. Вам будет казаться, что если бы Вы купили какую-то акцию, то Вы бы могли заработать 10-20%! 🚀📈

После этого, вероятно, Вы будете читать записки в Пульсе, пытаясь найти ту акцию, которая взлетит следующей... 🤔

После чего, с Вами может произойти две ситуации:

1️⃣ Хорошая ситуация: Вы на этом потеряете 20-30% Вашего счета и поймёте, что всё это не работает, и что всё это депозит.

2️⃣ Ужасная ситуация: У Вас получится заработать 20-30% к Вашему депозиту 😨😱


Казалось бы, я что-то перепутал, и всё наоборот... Но, друзья, я ничего не перепутал 😌 это действительно ужасная ситуация. Потому что Ваш мозг 🧠 получит такое огромное количество дофамина, что Вы подсядите на это...

Вы будете приходить на биржу не за инвестициями (как изначально собирались). Вы будете приходить на биржу как в казино 🎰 

– "Повезёт сегодня или не повезет?"

👆 Вот после того, как Вам в голову придёт эта мысль, вероятность того, что Вы сможете когда-нибудь повысить свой уровень заработка, сильно упадёт 😔

Как же грамотно поступить Вам чтобы Вы не потерялись на Бирже и случайно не попали в Казино? 🎰

